#include "GLDebugFont.h"
#include "utils.h"

#define LOCAL_DEBUG 0

extern unsigned char sFontData[];

GLDebugFont::GLDebugFont(int screenWidth, int screenHeight):
	m_texturesInitialized(false),
	m_texture(0),
	m_screenWidth(screenWidth),
	m_screenHeight(screenHeight) {
	resetFont(screenWidth, screenHeight);
}

GLDebugFont::~GLDebugFont(void) {
}

void GLDebugFont::releaseFont(void) {
	if (LIKELY(m_texture > 0)) {
#if LOCAL_DEBUG
		LOGV("GLDebugFont::releaseFont:delete font texture:m_texture=%d", m_texture);
#endif
		glDeleteTextures(1, &m_texture);
		glBindTexture(GL_TEXTURE_2D, 0);
		internal_clear();
	}
}

void GLDebugFont::resetFont(int screenWidth, int screenHeight) {
	
	bool force = !glIsTexture(m_texture);
	if (LIKELY(!force) && (m_screenWidth == screenWidth) && (m_screenHeight == screenHeight))
		return;

#if LOCAL_DEBUG
	LOGV("GLDebugFont::resetFont:%d", force);
#endif
	m_screenWidth = screenWidth;
	m_screenHeight = screenHeight;

	if (UNLIKELY(force || !m_texturesInitialized)) {
		releaseFont();
		glGenTextures(1, &m_texture);
		glBindTexture(GL_TEXTURE_2D, m_texture);
		glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_LINEAR);
		glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_LINEAR);
// Changed internalFormat from 3 to GL_RGB because GL_INVALID_VALUE error occured.
//		glTexImage2D(GL_TEXTURE_2D, 0, 3, 256 , 256 , 0, GL_RGB, GL_UNSIGNED_BYTE, &sFontData[0]);
		glTexImage2D(GL_TEXTURE_2D, 0, GL_RGB, 256 , 256 , 0, GL_RGB, GL_UNSIGNED_BYTE, &sFontData[0]);
		m_texturesInitialized = true;
		glBindTexture(GL_TEXTURE_2D, 0);
	}

#if LOCAL_DEBUG
	LOGD("generating font at resolution %d,%d,m_exture=%d", screenWidth, screenHeight, m_texture);
#endif
}

#define USE_ARRAYS 1

void GLDebugFont::GLDebugDrawStringInternal(int x, int y, const char *string, const btVector3 &rgb) {
	GLDebugDrawStringInternal(x, y, string, rgb, true, 10);
}

void GLDebugFont::GLDebugDrawStringInternal(
	int x, int y,
	const char *string, const btVector3 &rgb, bool enableBlend, int spacing) {

	if (UNLIKELY(!m_texturesInitialized)) {
		resetFont(m_screenWidth, m_screenHeight);
	}
	if (LIKELY(strlen(string))) {
		
		glColor4f(rgb.getX(),rgb.getY(),rgb.getZ(),1.f);
		float	cx;
		float	cy;

		glMatrixMode(GL_TEXTURE);
		glLoadIdentity();

// Comment out these lines because OpenGL ES does not support automatic texture generation.
/*		glDisable(GL_TEXTURE_GEN_S);
		glDisable(GL_TEXTURE_GEN_T);
		glDisable(GL_TEXTURE_GEN_R); */

		glEnable(GL_TEXTURE_2D);
		glBlendFunc(GL_SRC_ALPHA,GL_ONE);
		glDepthFunc(GL_LEQUAL);
		
		if (enableBlend) {
			glEnable(GL_BLEND);
		} else {
			glDisable(GL_BLEND);
		}
		glEnable(GL_DEPTH_TEST);
		glBindTexture(GL_TEXTURE_2D, m_texture);
		glDisable(GL_DEPTH_TEST);
		glMatrixMode(GL_PROJECTION);
		glPushMatrix();
		glLoadIdentity();

		glOrthof(0, m_screenWidth, 0, m_screenHeight, -1, 1);

		glMatrixMode(GL_MODELVIEW);
		glPushMatrix();
		glLoadIdentity();
		glTranslatef(btScalar(x), btScalar(m_screenHeight - y), btScalar(0));

#if USE_ARRAYS
		glDisableClientState(GL_COLOR_ARRAY);
		glDisableClientState(GL_NORMAL_ARRAY);
		glEnableClientState(GL_VERTEX_ARRAY);
		glEnableClientState (GL_TEXTURE_COORD_ARRAY);
#endif

		GLfloat verts[] = {
			0.0f, 1.0f, 0.0f,
			-1.0f, -1.0f, 0.0f,
			1.0f, -1.0f, 0.0f,
			0.f,0.f,0.f
		};
		
		GLfloat uv_texcoords[] = {
			0,0,
			0,0,
			0,0,
			0,0
		};
		verts[0] = 0;		verts[1] = 0;		verts[2] = 0;
		verts[3] = 16-1;	verts[4] = 0;		verts[5] = 0;
		verts[6] = 16-1;	verts[7] = 16-1;	verts[8] = 0;
		verts[9] = 0;		verts[10] = 16-1;	verts[11] = 0;
		
		for (int i = 0; i < int (strlen(string)); i++) {
			char ch = string[i]-32;
			if (ch >= 0) {
				cx=float(ch%16) * btScalar(1./16.f);
				cy=float(ch/16) * btScalar(1./16.f);

				uv_texcoords[0] = cx;			uv_texcoords[1] = btScalar(1-cy-1./16.f);
				uv_texcoords[2] = btScalar(cx+1./16.f);	uv_texcoords[3] = btScalar(1-cy-1./16.f);
				uv_texcoords[4] = btScalar(cx+1./16.f);	uv_texcoords[5] = btScalar(1-cy);
				uv_texcoords[6] = cx;			uv_texcoords[7] = btScalar(1-cy);
#if USE_ARRAYS
				glTexCoordPointer(2, GL_FLOAT, 0, uv_texcoords);
				glVertexPointer(3, GL_FLOAT, 0, verts);
				glDrawArrays(GL_TRIANGLE_FAN, 0, 4);
#else
				glBegin(GL_QUADS);
				glTexCoord2f(cx,1-cy-1./16.f);

				glVertex2i(0,0);
				glTexCoord2f(cx+1./16.f,1-cy-1./16.f);

				glVertex2i(16 - 1,0);
				glTexCoord2f(cx+1./16.f,1-cy);

				glVertex2i(16 - 1,16 -1);
				glTexCoord2f(cx,1-cy);

				glVertex2i(0,16 -1);
				glEnd();
#endif			

				glTranslatef(spacing, 0, 0);
			}
		}

		glMatrixMode(GL_PROJECTION);
		glPopMatrix();
		glMatrixMode(GL_MODELVIEW);
		glPopMatrix();
#if 1
		glEnable(GL_DEPTH_TEST);
		glBlendFunc(GL_SRC_ALPHA,GL_ONE);
		glDepthFunc (GL_LEQUAL);
		glDisable(GL_BLEND);
		glDisable(GL_TEXTURE_2D);

		glMatrixMode(GL_TEXTURE);
		glLoadIdentity();
		glScalef(btScalar(0.025), btScalar(0.025), btScalar(0.025));
#endif
		glMatrixMode(GL_MODELVIEW);
#if USE_ARRAYS
		glDisableClientState(GL_VERTEX_ARRAY);
		glDisableClientState (GL_TEXTURE_COORD_ARRAY);
#endif
	}
}

void GLDebugFont::GLDebugDrawString(int x, int y, const char *string) {
	btVector3 rgb(1,1,1);
	GLDebugDrawStringInternal(x, y, string, rgb);
}


